import React from "react";

function WindowWithForm({ title, text, children }) {
  return (
    <div className="window">
      <h2 className="window__title">{title}</h2>
      <form className="window__form">
        <input className="window__form-item" type="email" name="email" placeholder="Email" />
        <input className="window__form-item" type="text" name="text" placeholder="Пароль" />
      </form>
      <button className="window__button">{text}</button>
      {children}
    </div>
  );
}

export default WindowWithForm;
